import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-column">
        <h4>About Us</h4>
        <ul>
          <li>Our Story</li>
          <li>Work With Us</li>
          <li>Press & Media</li>
          <li>Privacy & Sequrity</li>
        </ul>
      </div>
      <div className="footer-column">
        <h4>Column 2</h4>
        <ul>
          <li>Subtitle 1</li>
          <li>Subtitle 2</li>
          <li>Subtitle 3</li>
          <li>Subtitle 4</li>
        </ul>
      </div>
      {/* Repeat similar structure for the remaining columns */}
      {/* Column 3, 4, 5, 6, and 7 */}
    </footer>
  );
};

export default Footer;
